import Link from 'next/link';

export default function Index() {
  return (
    <>
      <div>
        <p>Hello next.js</p>
        {['lol'].map((el) => <p>{el}</p>)}
        <a href="/about">Server Side Route to About?</a><br/>
        <Link href="/about" title="About Page"><a>Client Side Route to About</a></Link>
      </div>
    </>
  )
}
